import { useEffect } from "react";

const Post = (post) => {
    useEffect(() => {
        console.log(user);
        console.log(title);
        console.log(text);
    }, []);

    return (
        <div>
            <p>{post.user}</p>
            <h4>{post.title}</h4>
            <p>{post.text}</p>
        </div>
    )
}

export default Post;
